import React from "react";
import {useState} from "react";

const Main = () => {
    const [pname, setpname] = useState(" ");
    return (
        <div>
            <h1>OPD Booking service</h1>
            <form>
                <input
                    type="text"
                    placeholder="type your name"
                    value={pname}
                    onChange={(e) => {
                        e.preventDefault();
                        setpname((p) => {
                            return {p, pname: p.target.value};
                        });
                    }}
                />
            </form>
        </div>
    );
};

export default Main;
